import React from 'react';

const Cipher = (props) => {
    return (
        <section className="box">
            <div className="ciphertext">
                <p>CipherText</p>
                <textarea 
                    onChange={props.changed}
                    value={props.ciphertext}
                    name="ciphertext"></textarea>
            </div>
        </section>
    );
}

export default Cipher;
